import * as React from 'react';
import Card from '@mui/material/Card';
import CardContent from '@mui/material/CardContent';
import Typography from '@mui/material/Typography';
import { Button, CardActionArea, CardActions, CardHeader, TextField } from '@mui/material';

export default function MultiActionAreaCard() {
  return (
    <Card sx={{ maxWidth: 500 }}>
      <CardActionArea>
        <CardHeader 
          sx={{backgroundColor:"#d3d3d3", fontWeight: 'bolder'}}
          height="200"
          title='Create an Organization'
        />
        <CardContent>
          <Typography gutterBottom component="p" sx={{fontSize:'13px'}}>
            Organizations allow you to invite team members and assign them to workspaces
          </Typography>
          <div>
            <Typography>Organization Name</Typography>
            <TextField id="outlined-basic" variant="outlined" fullWidth  size="small" sx={{ fontWeight: 'bolder'}}/>
          </div>
        </CardContent>
      </CardActionArea>
      <CardActions>
      <Button variant="contained" size="large" sx={{backgroundColor: "#9F77EB",ml: 10,mt: 2,
        ":hover": {
          bgcolor: "#9F77EB",
          color: "white",
        },}}>
        Create Organization
      </Button>
      </CardActions>
    </Card>
  );
}
